import { combineReducers } from 'redux';

import auth from './auth';
import alert from './alert';
import day from './day';
import global from './global';
import reservation from './reservation';
import user from './user';

export default combineReducers({
	alert,
	auth,
	day,
	global,
	reservation,
	user,
});
